
CREATE TABLE IF NOT EXISTS employees (
    "Username" VARCHAR(255) PRIMARY KEY,
    "First name" VARCHAR(100),
    "Last name" VARCHAR(100),
    "Display name" VARCHAR(200),
    "Job title" VARCHAR(100),
    "Department" VARCHAR(100),
    "Office number" VARCHAR(20),
    "Office phone" VARCHAR(20),
    "Mobile phone" VARCHAR(20),
    "Fax" VARCHAR(20),
    "Alternate email address" VARCHAR(255),
    "Address" VARCHAR(255),
    "City" VARCHAR(100),
    "State or province" VARCHAR(100),
    "ZIP or postal code" VARCHAR(20),
    "Country or region" VARCHAR(100),
    "Date of Birth" DATE,
    "Gender" VARCHAR(50),
    "Start Date" DATE,
    "End Date" DATE,
    "Salary" INTEGER,
    "Manager" VARCHAR(100),
    "Work Email" VARCHAR(255)
);


